import React from "react";
import PageTitle from "../components/Typography/PageTitle";
import SectionTitle from "../components/Typography/SectionTitle";
import InfoCard from "../components/Cards/InfoCard";
import { Card, CardBody } from "@windmill/react-ui";
import { CartIcon, ChatIcon, MoneyIcon, PeopleIcon } from "../icons";
import RoundIcon from "../components/RoundIcon";
import { FaComputer } from 'react-icons/fa6'; // Import the necessary icon

function Curriculum() {
  return (
    <>
      <PageTitle>Academic Curriculum</PageTitle>

      <div className="grid gap-6 mb-8 md:grid-cols-2 xl:grid-cols-4">
        <div key="unique_id" className="bg-gray-50 p-3 rounded-2xl relative">
          {/* Department Icon and Name */}
          <div className="flex flex-col items-center justify-center mb-3">
            <div className="flex justify-center items-center mb-2 border-2 border-color: rgb(130 128 255); rounded-full w-12 h-12 bg-white">
              <FaComputer size={24} color="#8583FC" />
            </div>
            <p className="text-lg font-bold mt-2" style={{ color: "black" }}>
              Computer Science {/* Sample department name */}
            </p>
          </div>
        </div>
        {/* Repeat this div block for each card you want to display */}
      </div>
    </>
  );
}

export default Curriculum;
